import base64, re, json
cmd = """{{ cmd }}"""
m = re.search(r"-(?:enc|encodedcommand)\s+([A-Za-z0-9+/=_-]+)", cmd, re.I)
decoded = ""
if m:
    b64 = m.group(1)
    for charset in ("utf-16le","utf-8","latin-1"):
        try:
            decoded = base64.b64decode(b64 + "==").decode(charset, "ignore")
            break
        except:
            pass
print(json.dumps({"decoded": decoded}))
